import { GoogleMap, MarkerF, PolygonF, useJsApiLoader } from '@react-google-maps/api';
import React, { useState } from 'react';

const containerStyle = {
  width: '100%',
  height: '600px',
};

// Center point set to India level
const center = {
  lat: 20.5937,  // Latitude of India
  lng: 78.9629,  // Longitude of India
};

const zoomLevel = 5;  // Adjusted zoom level for the India view

// Coordinates for the Jharkhand polygon
const jharkhandCoords = [
    { lat: 24.4125, lng: 83.4258 },  // 24°24'45"N 83°25'33"E
    { lat: 22.5828, lng: 84.0825 },  // 22°34'58"N 84°04'57"E
    { lat: 22.1931, lng: 85.0492 },  // 22°11'35"N 85°02'57"E
    { lat: 22.3264, lng: 86.4536 },  // 22°19'35"N 86°27'13"E
    { lat: 22.6908, lng: 86.5150 },  // 22°41'27"N 86°30'54"E
    { lat: 23.3169, lng: 85.8747 },  // 23°19'01"N 85°52'29"E
    { lat: 23.6617, lng: 86.6256 },  // 23°39'42"N 86°37'32"E
    { lat: 24.5783, lng: 87.8997 },  // 24°34'42"N 87°53'59"E
    { lat: 25.1028, lng: 87.7900 },  // 25°06'10"N 87°47'24"E
    { lat: 25.1114, lng: 87.2681 },  // 25°06'41"N 87°16'05"E
    { lat: 24.8217, lng: 85.7231 },  // 24°49'18"N 85°43'23"E
    { lat: 24.5261, lng: 83.4228 },  // 24°31'34"N 83°25'22"E  // Closing the polygon
];

// Coordinates for Ranchi
const ranchiCoords = [
  { lat: 23.3697, lng: 85.2203 }, // 23°22'11"N 85°13'13"E
  { lat: 23.3181, lng: 85.2467 }, // 23°19'05"N 85°14'48"E
  { lat: 23.2417, lng: 85.3036 }, // 23°14'30"N 85°18'13"E
  { lat: 23.3111, lng: 85.3928 }, // 23°18'40"N 85°23'34"E
  { lat: 23.3886, lng: 85.4356 }, // 23°23'19"N 85°26'08"E
  { lat: 23.4058, lng: 85.4153 }, // 23°24'21"N 85°24'55"E
  { lat: 23.4394, lng: 85.3589 }, // 23°26'22"N 85°21'32"E
  { lat: 23.4481, lng: 85.3019 }, // 23°26'53"N 85°18'07"E
  { lat: 23.4058, lng: 85.2614 }, // 23°24'21"N 85°15'41"E
  { lat: 23.4281, lng: 85.2169 }, // 23°25'41"N 85°13'01"E
];

// Coordinates for the new polygon
const newPolygonCoords = [
  { lat: 23.4908, lng: 85.4683 }, // 23°29'27"N 85°28'06"E
  { lat: 23.4836, lng: 85.4647 }, // 23°29'01"N 85°27'53"E
  { lat: 23.4794, lng: 85.4678 }, // 23°28'46"N 85°28'04"E
  { lat: 23.4769, lng: 85.4725 }, // 23°28'37"N 85°28'21"E
  { lat: 23.4758, lng: 85.4803 }, // 23°28'33"N 85°28'49"E
  { lat: 23.4800, lng: 85.4850 }, // 23°28'48"N 85°29'06"E
  { lat: 23.4819, lng: 85.4872 }, // 23°28'55"N 85°29'14"E
  { lat: 23.4911, lng: 85.4889 }, // 23°29'28"N 85°29'20"E
  { lat: 23.4900, lng: 85.4753 }, // 23°29'24"N 85°28'31"E
  { lat: 23.4917, lng: 85.4686 }, // 23°29'30"N 85°28'07"E
];

const additionalPolygonCoords = [
    { lat: 23.4431, lng: 85.4590 }, // 23°26'35"N 85°27'32"E
    { lat: 23.4430, lng: 85.4595 }, // 23°26'32"N 85°27'34"E
    { lat: 23.4430, lng: 85.4600 }, // 23°26'32"N 85°27'38"E
    { lat: 23.4433, lng: 85.4602 }, // 23°26'34"N 85°27'40"E
    { lat: 23.4435, lng: 85.4598 }, // 23°26'36"N 85°27'37"E
    { lat: 23.4431, lng: 85.4590 }, // 23°26'35"N 85°27'32"E (Closing the polygon)
  ];

// Coordinates for Casa Blanca Estate in Rukka, Jharkhand
const casaBlancaCoords = { lat: 23.443576748453125, lng: 85.46080978467886 };

// Coordinates for Ormanji
const ormanjiCoords = { lat: 23.3680, lng: 85.3200 };

const MapComponent = () => {
  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: "AIzaSyChN074R5gt4BfPTFox9UXnND0S8yyH6Dk", // Replace with your Google Maps API key
  });

  const [showJharkhandPolygon, setShowJharkhandPolygon] = useState(true);
  const [showRanchiPolygon, setShowRanchiPolygon] = useState(true);
  const [showNewPolygon, setShowNewPolygon] = useState(true);

  const handleJharkhandPolygonClick = () => {
    setShowJharkhandPolygon(false);  // Hide Jharkhand polygon when clicked
  };

  return isLoaded ? (
    <GoogleMap mapContainerStyle={containerStyle} center={center} zoom={zoomLevel}>
      {/* Polygon covering Jharkhand */}
      {showJharkhandPolygon && (
        <PolygonF
          paths={jharkhandCoords}
          options={{
            fillColor: '#FF0000', // Fill color for Jharkhand polygon
            strokeColor: '#000000',
            strokeWeight: 2,
            fillOpacity: 0.6,
          }}
          onClick={handleJharkhandPolygonClick} // Click event to hide the Jharkhand polygon
        />
      )}

      {/* Polygon covering Ranchi */}
      {showRanchiPolygon && (
        <PolygonF
          paths={ranchiCoords}
          options={{
            fillColor: '#0000FF', // Fill color for Ranchi polygon
            strokeColor: '#000000',
            strokeWeight: 2,
            fillOpacity: 0.6,
          }}
        />
      )}

      {/* New polygon */}
      {showNewPolygon && (
        <PolygonF
          paths={newPolygonCoords}
          options={{
            fillColor: '#00FF00', // Fill color for the new polygon
            strokeColor: '#000000',
            strokeWeight: 2,
            fillOpacity: 0.6,
          }}
        />
      )}

      {/* Marker on Casa Blanca Estate */}
      <MarkerF
        position={casaBlancaCoords}
        title="Casa Blanca Estate, Rukka"
      />

      {/* Marker for Ormanji */}
      <MarkerF
        position={ormanjiCoords}
        title="Ormanji"
      />
    </GoogleMap>
  ) : <></>;
};

export default MapComponent;
